/*Table structure for table `check_danger_ledger` */

DROP TABLE IF EXISTS `check_danger_ledger`;

CREATE TABLE `check_danger_ledger` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `investigation_time` datetime DEFAULT NULL COMMENT '排查时间',
  `investigation_org_person_fk` varchar(255) DEFAULT NULL COMMENT '排查人ID',
  `investigation_org_person_name` varchar(255) DEFAULT NULL COMMENT '排查人姓名',
  `rectification_position` varchar(255) DEFAULT NULL COMMENT '隐患部位',
  `rectification_name` varchar(255) DEFAULT NULL COMMENT '隐患名称',
  `rectification_level` varchar(255) DEFAULT NULL COMMENT '隐患等级',
  `government_measure` varchar(255) DEFAULT NULL COMMENT '治理措施',
  `complate_time` varchar(255) DEFAULT NULL COMMENT '完成时间',
  `control_org_fk` varchar(255) DEFAULT NULL COMMENT '责任部门ID',
  `control_org_name` varchar(255) DEFAULT NULL COMMENT '责任部门名称',
  `control_org_person_fk` varchar(255) DEFAULT NULL COMMENT '责任人ID',
  `control_org_person_name` varchar(255) DEFAULT NULL COMMENT '责任人姓名',
  `review_time` datetime DEFAULT NULL COMMENT '复查时间',
  `review_person_fk` varchar(255) DEFAULT NULL COMMENT '复查人id',
  `review_person_name` varchar(255) DEFAULT NULL COMMENT '复查人姓名',
  `review_result` varchar(255) DEFAULT NULL COMMENT '复查结果',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `offgrade_list_fk` varchar(255) DEFAULT NULL COMMENT '填写否的记录ID',
  `check_type` varchar(255) DEFAULT NULL COMMENT '不合格项来源',
  `rectification_position_url` longtext COMMENT '隐患部位图片路径',
  `review_result_url` longtext COMMENT '排查结果图片路径',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='隐患治理信息台账';

