/*Table structure for table `check_day` */

DROP TABLE IF EXISTS `check_day`;

CREATE TABLE `check_day` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `check_start_time` datetime DEFAULT NULL COMMENT '排查开始时间',
  `check_end_time` datetime DEFAULT NULL COMMENT '排查结束时间',
  `check_person_fk` varchar(255) DEFAULT NULL COMMENT '排查人ID',
  `check_person_name` varchar(255) DEFAULT NULL COMMENT '排查人名称',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '机构ID',
  `org_name` varchar(255) DEFAULT NULL COMMENT '机构名称',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='日治理记录';

/*Data for the table `check_day` */

insert  into `check_day`(`id`,`check_start_time`,`check_end_time`,`check_person_fk`,`check_person_name`,`create_time`,`modify_time`,`org_fk`,`org_name`,`create_person_fk`) values ('6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL,NULL,NULL,'2019-01-01 00:00:00',NULL,'0528160b1191413d81862615dbdd15c3',NULL,NULL),('94074c5ceb7a4b30a847dd47bbde4271',NULL,NULL,NULL,NULL,'2019-01-01 00:00:00',NULL,'654e51ba0c8a4ede8989551a8e711718',NULL,NULL);

/*Table structure for table `check_day_category` */

DROP TABLE IF EXISTS `check_day_category`;

CREATE TABLE `check_day_category` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `type_name` varchar(255) DEFAULT NULL COMMENT '类别名称(运矿等)',
  `content` varchar(255) DEFAULT NULL COMMENT '说明内容',
  `person_fk` varchar(255) DEFAULT NULL COMMENT '检查人ID',
  `person_name` varchar(255) DEFAULT NULL COMMENT '检查人名称',
  `check_time` datetime DEFAULT NULL COMMENT '检查时间',
  `check_day_fk` varchar(255) DEFAULT NULL COMMENT '日检查ID',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='日治理记录大类';

/*Data for the table `check_day_category` */

/*Table structure for table `check_day_list` */

DROP TABLE IF EXISTS `check_day_list`;

CREATE TABLE `check_day_list` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `check_type_fk` varchar(255) DEFAULT NULL COMMENT '检查类别ID',
  `check_type_name` varchar(255) DEFAULT NULL COMMENT '检查类别名称',
  `check_content` varchar(2000) DEFAULT NULL COMMENT '检查内容',
  `check_method` varchar(255) DEFAULT NULL COMMENT '检查方法',
  `check_day_category_fk` varchar(255) DEFAULT NULL COMMENT '日检查分类外键',
  `risk_identification_list_id` varchar(32) DEFAULT NULL COMMENT '安全风险识别列表ID',
  `cause` varchar(255) DEFAULT NULL COMMENT '安全风险识别原因',
  `level_name` varchar(255) DEFAULT NULL COMMENT '安全风险识别风险等级名称',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `check_day_fk` varchar(32) DEFAULT NULL COMMENT '日治理外键',
  `check_team_fk` varchar(32) DEFAULT NULL COMMENT '班组ID',
  `check_team_name` varchar(255) DEFAULT NULL COMMENT '班组名称',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='日治理记录列表';

/*Data for the table `check_day_list` */

insert  into `check_day_list`(`id`,`check_type_fk`,`check_type_name`,`check_content`,`check_method`,`check_day_category_fk`,`risk_identification_list_id`,`cause`,`level_name`,`create_time`,`modify_time`,`create_person_fk`,`org_fk`,`check_day_fk`,`check_team_fk`,`check_team_name`) values ('19dfc95ea7f949cdb3a78c9b3eebd224',NULL,'','对润滑部位加注足够的润滑油、脂；接好风管，风压轴承，管路无泄露现象。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('1e6634b26f28449da7a98cec3b3272ee',NULL,'','风管接头要紧固，防止脱节伤人。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('22e759a52f6743df8adfd1cab9aa5a47',NULL,'','检查使用工具','操作人员自查，班组长检查',NULL,'772b397f541e4ecd8f3cd049966d6074',NULL,'一般风险','2019-08-21 22:21:35',NULL,NULL,'654e51ba0c8a4ede8989551a8e711718','94074c5ceb7a4b30a847dd47bbde4271',NULL,NULL),('2799dffe55fd443daf2b4b3ea9072b1b',NULL,'','空压机运转前，仔细检查设备的完好情况，安全阀、压力表、干燥及润滑、冷却系统正常。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('310c1b1ca9fe42f787110ca36b18bfc1',NULL,'','电缆及其他电气元件绝缘可靠。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('351d3175a7714e91b95f2536cd47be93',NULL,'','起落钻架时，非操作人员不应在危险范围内停留。','GB16423-2006-5. 2.2.3',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('570fa5f7c8ef4805833f62049952915a',NULL,'','检查空压机排气压力、润滑油供应、排气温度、电流是否正常。是否存在机器振动严重，机器声音异常，闻到烧糊异味等情况。正常运转中进行检查时，身体各部位不得接触运转部件。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('5ddc77732e5f47a1a1a5ebb20baefbb6',NULL,'','安全用具、工具、易损部件和辅助材料准备齐全。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('5ef302a4c2e343adb10ed160099c5d0f',NULL,'','钻机稳车时，应与台阶坡顶线保持足够的安全距离。外侧突出部分至台阶坡顶线的最小距离为2m；如有龟裂缝，外侧突出部分至龟裂缝最小距离2m。','GB16423-2006 -5.2.2.1',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('62e349560623478eb8e391324bf75246',NULL,'','作业人员应按规定穿戴工作服、安全帽、防尘口罩等防护用品。','GB16423-2006-4.17',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('6acc4e342ffc4e16a259b0852484652a',NULL,'','空压机设备、地面卫生清洁，机房严禁堆放杂物，灭火器、灭火砂等消防设施完善；安全警示标志齐全；电气线路敷设整齐。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('8ebb340cdea8408d973a27b0c6b74c9c',NULL,'','两班以上作业的是否认真进行交接班，认真填写交接班记录。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:50','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('8f47db6cf1e5487b8f6b48872a3cb9fb',NULL,'','各操作机构处于停止位置，仪表指针处在零位。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('a804d64b694f4275be435259c7f59cbb',NULL,'','检查有无酒后上岗','现场检查',NULL,'deefd636f3af493e99c76f565c20e1b2',NULL,'低风险','2019-08-21 22:58:10',NULL,NULL,'654e51ba0c8a4ede8989551a8e711718','94074c5ceb7a4b30a847dd47bbde4271',NULL,NULL),('ac161546041d4f4d927629c92eeae751',NULL,'','孔口有人工作时，禁止向冲击器送风。','安全技术操作规程',NULL,'837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:54:49','2019-06-02 06:55:52',NULL,NULL,'6b0305044cd4438d8041ae9b7a6d54ab',NULL,NULL),('bb86eadbbe334dd2801aad4582d4ef02',NULL,'','