1 09:21:01','2019-06-02 06:56:11',NULL,NULL),('b368210f90e747c8a83126df75e261cb',NULL,'安全机构及人员配置','设立安全生产领导小组、职业卫生领导小组、标准化领导小组、应急救援指挥体系，设立安全科、专兼职应急救护队，相关组织机构上墙。','检查资料和现场','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:21:55','2019-06-02 06:56:11',NULL,NULL),('b866e81caf824517bc206a82eb0ef278',NULL,'安全机构及人员配置','主要负责人或实际控制人是安全生产第一责任人，应与法定代表人一致，如不一致应有法人聘书。','核对人员查看聘书','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:21:55','2019-06-02 06:56:11',NULL,NULL),('b9c3cc3231f54271b974de3a097434f3',NULL,'安全投入与工伤保险','依法参加工伤社会保险，为从业人员缴纳工伤保险费。','检查资料','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:24:49','2019-06-02 06:56:11',NULL,NULL),('bbfa57ea301f46509dd45b886b6205ec',NULL,'基本条件','《采矿许可证》、《工商营业执照》、《安全生产许可证》均在有效期范围内。','检查原件','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:21:01','2019-06-02 06:56:11',NULL,NULL),('c887a9dd372e44aeb7f2892b01b0e944',NULL,'基本条件','新、改、扩建项目安全设施依法履行“三同时”；必须聘请有资质的施工和监理单位；按规定保留开采设计、安全设施设计、设计评审及批准意见、竣工验收意见；保存每年测绘的采石场开采现状平面图和剖面图等相关的图纸资料。','检查资料','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:21:01','2019-06-02 06:56:11',NULL,NULL),('cec2ca1d4f9149dfb50cc478a8e2001c',NULL,'安全投入与工伤保险','按有关要求和计划逐月提取安全技术措施经费，专项用于安全生产，不得挪作他用，专帐管理，留存相关票据。','检查资料','8f76e53194774cc6850bfb2c7262d93c','837cfe69e12e4a00885c935d18858893',NULL,'重大风险','2019-05-31 09:24:49','2019-06-02 06:56:11',NULL,NULL);

