/*Table structure for table `check_rectification_receipt` */

DROP TABLE IF EXISTS `check_rectification_receipt`;

CREATE TABLE `check_rectification_receipt` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `check_org_fk` varchar(255) DEFAULT NULL COMMENT '受检单位ID',
  `check_org_name` varchar(255) DEFAULT NULL COMMENT '受检单位名称',
  `fill_time` datetime DEFAULT NULL COMMENT '填写时间',
  `check_person_fk` varchar(255) DEFAULT NULL COMMENT '检查人员ID',
  `check_person_name` varchar(255) DEFAULT NULL COMMENT '检查人员姓名',
  `check_time` datetime DEFAULT NULL COMMENT '检查日期',
  `check_code` varchar(32) DEFAULT NULL COMMENT '编号',
  `rectification_org_fk` varchar(255) DEFAULT NULL COMMENT '隐患整改部门ID',
  `rectification_org_name` varchar(255) DEFAULT NULL COMMENT '隐患整改部门名称',
  `rectification_person_fk` varchar(255) DEFAULT NULL COMMENT '整改部门负责人ID',
  `rectification_person_name` varchar(255) DEFAULT NULL COMMENT '整改部门负责人姓名',
  `rectification_content` varchar(1000) DEFAULT NULL COMMENT '隐患内容及整改要求',
  `rectification_time` datetime DEFAULT NULL COMMENT '整改期限',
  `rectification_measure` varchar(255) DEFAULT NULL COMMENT '整改措施',
  `rectification_result` varchar(255) DEFAULT NULL COMMENT '整改结果',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `org_name` varchar(255) DEFAULT NULL COMMENT '所属机构名称',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `record_list_fk` varchar(255) DEFAULT NULL COMMENT '填写否的记录ID',
  `check_type` varchar(255) DEFAULT NULL COMMENT '不合格项来源',
  `rectification_content_url` text COMMENT '隐患内容及整改要求图片',
  `rectification_result_url` text COMMENT '验收意见图片',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='隐患整改回执单';

