insert  into `check_special_list`(`id`,`check_type_fk`,`check_type_name`,`check_content`,`check_special_fk`,`risk_identification_list_id`,`cause`,`level_name`,`create_time`,`modify_time`,`create_person_fk`,`org_fk`) values ('0d4281f5c70f492e987016782ad07a0a',NULL,'边坡','是否遵循自上而下开采顺序，分台阶的开采','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:17:50','2019-06-02 06:56:23',NULL,NULL),('118b22a5fc654bb5b1c036386a86eee2',NULL,'应急救援系统','适合本单位的事故应急救援预案','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:23:13','2019-06-02 06:56:23',NULL,NULL),('1f13c8f62d0847c9a2efe9f707498ec4',NULL,'边坡','开采的阶段高度，平台宽度，边坡角和最坡角是否符《规程》要求','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:17:50','2019-06-02 06:56:23',NULL,NULL),('2b323817076642148a324419e2eee368',NULL,'边坡','是否对边坡进行定点定期观测','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:17:50','2019-06-02 06:56:23',NULL,NULL),('372e7bd716954270ae69813343de1eb4',NULL,'职业危害','工人作业地点空气中有害物质的浓度，必须按国家规定方法定期检测，对粉尘作业点每月至少检测两次','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('37e948e10c7c4cd8b6146d03b6309d50',NULL,'紧急通讯','矿山设固定电话以满足对矿内外通讯','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:20:14','2019-06-02 06:56:23',NULL,NULL),('3a998d5e501e4ac18697eab1a75380ec',NULL,'配电系统','电力装置，是否符合GB50070和DL408的要求','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('3f1bc3e1cebe44bd9c6f5d0d81c2027c',NULL,'应急救援系统','建立应急救援组织','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:23:13','2019-06-02 06:56:23',NULL,NULL),('4ac479354c064e03ac1d0960c5c17a4e',NULL,'职业危害','对接触有害物质的作业人员，必须进行定期的健康检查，建立健康档案','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('4e923ea57c1b4ce297aea2282b80b95f',NULL,'边坡','是否对边坡重点部位和有潜在滑坡危险的地段进行加固','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:17:50','2019-06-02 06:56:23',NULL,NULL),('580b89f117d8494088c421c3f51dbb0f',NULL,'紧急通讯','采场设对讲机','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:20:14','2019-06-02 06:56:23',NULL,NULL),('6cafe56b558f451aaa8c4a85c145941b',NULL,'防、排水系统','露天矿山应设置防、排水机构。大、中型露天矿应设专职水文地质人员，建立水文地质资料档案。每年应制定防持水措施','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:19:12','2019-06-02 06:56:23',NULL,NULL),('6e82f2f5b58f4398a6daf939130ce44a',NULL,'紧急通讯','矿区范围内要有警报器','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:20:14','2019-06-02 06:56:23',NULL,NULL),('6fe3806132394b5885b43895c3ed4385',NULL,'职业危害','对新入矿工人应进行职业健康检查(如胸透、听力测定、血液化验等指标)：并建立健康档；作业场所/案：；对接尘工人的职业健康检查应拍照胸大片：不适合从事矿山作业者不应录用','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('714297958bb54fd1bc5385a75b69aeef',NULL,'应急救援系统','定期及汛前进行应急救援演练','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:23:13','2019-06-02 06:56:23',NULL,NULL),('7e1bd1b791a549b8a8192013cd9de383',NULL,'配电系统','电气工作人员是否按规定考核合格后方准上岗，上岗应穿戴和使用防护用品、用具进行操作。维修电气设备和线路，是否由电气工作人员进行','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('87a9a880eb6940f1a0d73ae4b9269bb2',NULL,'三项制度落实','本单位安全生产制度及操作规程是否建立运行，完不完善','f238ca00b4b34038929097095da17fe6','93da0ea66d814a3fa332d96684dabd0d',NULL,'一般风险','2019-08-21 22:33:24',NULL,NULL,'654e51ba0c8a4ede8989551a8e711718'),('886fff160b384e088134a44e351978fa',NULL,'应急救援系统','与救护队或医疗机构签有救援协议','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:23:13','2019-06-02 06:56:23',NULL,NULL),('91831abd4729419a85811e5e0f1dfac2',NULL,'应急救援系统','提供应急救援资金与物质保障','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:23:13','2019-06-02 06:56:23',NULL,NULL),('941b097a3a3846ae81481b089006a4ae',NULL,'职业危害','露天矿开采应优先采用湿式作业。产尘点和产尘设备，应采取综合防尘技术措施','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('9d2c3ce57dec4497876a2fb1c6e6e64b',NULL,'配电系统','电气工作人员，应采取可靠的安全措施，并经生产矿长批准','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('a00601079d8c4244877caf30344c9167',NULL,'防、排水系统','露天采场的总出入沟口、工业场地，均应采取妥善的防洪措施','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:19:12','2019-06-02 06:56:23',NULL,NULL),('a5c3d662d1fd406495c34228b6d46340',NULL,'三项制度落实','检查本矿山安全生产责任制建立情况，是否全面','f238ca00b4b34038929097095da17fe6','99b93632a25941d49603520e18e6419b',NULL,'一般风险','2019-08-21 22:32:42',NULL,NULL,'654e51ba0c8a4ede8989551a8e711718'),('b81e5e8280ce4b3b8e3fe70c4bfcc31d',NULL,'防、排水系统','矿山应按设计要求建立排水系统。上方应设截水沟：有滑坡可能的矿山，应加强防排水措施：应防止地表、地下水渗露到采场','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:19:12','2019-06-02 06:56:23',NULL,NULL),('bd76f3c2de1143918c1989872c2220e4',NULL,'职业危害','露天矿的采掘设备与矿用自卸汽车的司机驾驶室，应配置空气调节装置，不应开窗作业','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('cbb063c2bca1424fa2092d051563c7bb',NULL,'边坡','在升举的车斗下检修时，是否采取安全可靠的安全指','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:17:50','2019-06-02 06:56:23',NULL,NULL),('ce6bfdc33b2d4b589903f546eb32776d',NULL,'配电系统','电气设备可能被人触及的露带电部分，应设置保护罩或遮拦及警示标志','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('cfe523669404442cb6bc1405b67c3019',NULL,'配电系统','在带电的导线、设备、变压器、油开关附近，不应有任何易燃易爆物品','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('d0acef509ea2451bad38b8d912c133f3',NULL,'配电系统','在带电设备周围，不应使用锅卷尺和带金属的线尺','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:18:28','2019-06-02 06:56:23',NULL,NULL),('dd4ff9307c82420a823bb991ac64a3ea',NULL,'职业危害','作业场所的噪声，不宜超过85dB，应积极采取防止噪声的措施，消除噪声危害。达不到噪声标准的作业场所，作业人员应佩戴防护用具','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 10:24:29','2019-06-02 06:56:23',NULL,NULL),('eeeda637061a4787b4b9e3f3743b569f',NULL,'防、排水系统','矿山所有排水设施及其机电设备的保护装置，应经主管部门批准，不应任意拆除','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:19:12','2019-06-02 06:56:23',NULL,NULL),('f9ce7a4564664efdb859a772fe90886a',NULL,'防、排水系统','应采取措施防止地表水渗入边坡岩体的软弱结构面或直接冲刷边坡。边坡岩体存在含层并影响边坡稳定时，应采取疏干降水措施','5d46647e4eb4416385d18025ed2668d1','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 10:19:12','2019-06-02 06:56:23',NULL,NULL);

/*Table structure for table `check_special_record` */

