insert  into `check_week_list`(`id`,`check_type_fk`,`check_type_name`,`check_content`,`check_method`,`check_week_fk`,`risk_identification_list_id`,`cause`,`level_name`,`create_time`,`modify_time`,`create_person_fk`,`org_fk`) values ('04c33575c4d54f18892104eb151774eb',NULL,'安全设施设备','颚石机、破碎机等产尘点设佩戴职业卫生个体劳保用品标志，颚石机处设防止坠落等安全标志；噪音较大作业场所设防止噪音危害标志。','检查现场','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:48','2019-06-02 06:56:06',NULL,NULL),('18829a85ace2490aa2329083220ff6ee',NULL,'三项制度落实','对采场工作边坡、边帮及运输、行人的非工作帮，应定期检查，记录规范。','检查','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:30:34','2019-06-02 06:56:06',NULL,NULL),('1d4ff8b5b3b84da1988eab4d7d8d906d',NULL,'安全设施设备','露天矿边界有可靠的围栏或醒目的警示标志；采场两侧边坡下方设置安全警示标志；爆破警戒区边界有警示标志；输送带处设防止跨越警示标志。','检查现场','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:48','2019-06-02 06:56:06',NULL,NULL),('21136b8325bb4cd89f41550c9b33748d',NULL,'隐患排查治理','相关科室、班组人员积极开展综合、专项、季节性和重点时段检查。','检查资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:27:55','2019-06-02 06:56:06',NULL,NULL),('225cf17b33734538b55c83c6383b39cd',NULL,'三项制度落实','落实班组会议和班组安全活动，各项记录规范。','检查','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:30:34','2019-06-02 06:56:06',NULL,NULL),('25225fa6434c462bb42c15f8f0fcb473',NULL,'隐患排查治理','安全科按上报时间要求，及时上报隐患排查治理统计、分析表；重大事故隐患要立即上报。','检查资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:27:55','2019-06-02 06:56:06',NULL,NULL),('331670e21d4143a99f367e579e957ab7',NULL,'三项制度落实','对发生的事件（事故）按要求进行登记、调查、报告和回顾。','降尘资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:30:34','2019-06-02 06:56:06',NULL,NULL),('440b401863194363a7504d1e9e72cc12',NULL,'职业健康安全','职业危害岗位作业人员按时参加体检，职业卫生档案健全，妥善保存。','检查','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:08','2019-06-02 06:56:06',NULL,NULL),('5481f0e8c0f7468f99f27f6ee521e6d8',NULL,'三项制度落实','对危险性较大设备按计划进行维护、保养、检修，记录规范。','检查','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:30:34','2019-06-02 06:56:06',NULL,NULL),('6322b66d07534e3fb83c27b07cff30a6',NULL,'安全投入与工伤保险','检查本单位安全投入情况','检查投入项目台账','4ea8af6742ec45c1a0190d6150b75158','433d49add4ec4c55967673c96393a6a0',NULL,'一般风险','2019-08-21 23:26:59',NULL,NULL,'654e51ba0c8a4ede8989551a8e711718'),('6722ab71bb494884a71a16ab035767c2',NULL,'职业健康安全','为作业人员提供并及时发放符合国家职业卫生标准和要求的个体职业防护用品，严格依照使用期限定期更换，并指导、督促作业人员正确使用。','检查发放资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:08','2019-06-02 06:56:06',NULL,NULL),('700ef8c422ae49a4951cfbad0417c438',NULL,'三项制度落实','按有关要求和计划逐月提取安全技术措施经费，专项用于安全生产，不得挪作他用，专帐管理，留存相关票据。','检查资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:30:34','2019-06-02 06:56:06',NULL,NULL),('81def2d62ba441209e25d54b3ceb53a8',NULL,'职业健康安全','明确职业卫生负责人和专（兼）职安全管理人员。','核对人员','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:08','2019-06-02 06:56:06',NULL,NULL),('8bb1cce901e34597ab98d82aae2f9700',NULL,'隐患排查治理','各重点危险源点有明确的监控和隐患排查责任人。','检查资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:27:55','2019-06-02 06:56:06',NULL,NULL),('951d47944f444dc2af37512d1225831e',NULL,'职业健康安全','积极采取综合防尘技术措施。破碎系统能正常加水降尘；装矿前对矿堆洒水或喷雾；采用湿式凿岩或干式捕尘技术；积极清除采面顶部岩土层，减少矿堆尘土量；输送带末端采用上下伸缩装置，减少粉尘产生。','检查现场','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'一般风险','2019-05-31 09:32:08','2019-06-02 06:56:06',NULL,NULL),('997c0713da814f0ab9f483ed66c74459',NULL,'隐患排查治理','安全科对举报（报告）的事故隐患认真登记和处理。','检查资料','3560fda3d2244d309f673d945a593be4','837cfe69e12e4a00885c935d18858893',NULL,'较大风险','2019-05-31 09:27:55','2019-06-02 06:56:06