/*Table structure for table `file_message` */

DROP TABLE IF EXISTS `file_message`;

CREATE TABLE `file_message` (
  `id` varchar(32) NOT NULL COMMENT '信息文件id，唯一标识UUID',
  `name` varchar(255) DEFAULT NULL COMMENT '信息文件名称',
  `path` varchar(255) DEFAULT NULL COMMENT '信息文件保存地址',
  `view_path` varchar(255) DEFAULT NULL COMMENT '预览地址',
  `type` smallint(2) DEFAULT NULL COMMENT '信息文件类型 1-内部信息 2-外部信息',
  `org_fk` varchar(40) DEFAULT NULL COMMENT '机构id',
  `create_person_fk` varchar(40) DEFAULT NULL COMMENT '创建人id',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='信息收集表';

