/*Table structure for table `person` */

DROP TABLE IF EXISTS `person`;

CREATE TABLE `person` (
  `id` varchar(40) NOT NULL,
  `login_id` varchar(40) NOT NULL,
  `realname` varchar(30) NOT NULL,
  `sex` char(2) DEFAULT NULL,
  `person_type` varchar(40) DEFAULT NULL,
  `org_id` varchar(40) DEFAULT NULL,
  `tel` varchar(30) DEFAULT NULL,
  `number` varchar(30) DEFAULT NULL COMMENT '编号',
  `email` varchar(30) DEFAULT NULL,
  `identity_no` varchar(30) DEFAULT NULL COMMENT '身份证号',
  `card_no` varchar(30) DEFAULT NULL COMMENT '卡号',
  `birthday` date DEFAULT NULL,
  `student_id` varchar(410) DEFAULT NULL COMMENT '孩子ID',
  `class_number` varchar(40) DEFAULT NULL,
  `start_year` varchar(30) DEFAULT NULL COMMENT '入学年份',
  `pic` varchar(512) DEFAULT '' COMMENT '头像',
  `openid` varchar(40) DEFAULT NULL COMMENT '微信openid',
  `del` int(11) NOT NULL DEFAULT '0',
  `createdatetime` datetime NOT NULL,
  `modifydatetime` datetime NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `login_id` (`login_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

