/*Table structure for table `risk_control_list` */

DROP TABLE IF EXISTS `risk_control_list`;

CREATE TABLE `risk_control_list` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `post_fk` varchar(255) DEFAULT NULL COMMENT '岗位单元ID',
  `post_name` varchar(255) DEFAULT NULL COMMENT '岗位单元名称',
  `harmful_factors` varchar(255) DEFAULT NULL COMMENT '危险有害因素',
  `level_fk` varchar(32) DEFAULT NULL COMMENT '安全风险等级id',
  `level_name` varchar(255) DEFAULT NULL COMMENT '安全风险等级名称',
  `level_num` varchar(32) DEFAULT NULL COMMENT '安全风险等级序号（排序使用）',
  `measure` varchar(255) DEFAULT NULL COMMENT '现有措施有效性',
  `department_fk` varchar(32) DEFAULT NULL COMMENT '部门id',
  `department_name` varchar(255) DEFAULT NULL COMMENT '部门名称',
  `person_fk` varchar(32) DEFAULT NULL COMMENT '责任人id',
  `person_name` varchar(255) DEFAULT NULL COMMENT '责任人名称',
  `risk_control_fk` varchar(32) DEFAULT NULL COMMENT '关联ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='安全风险分级管控列表';

/*Data for the table `risk_control_list` */

insert  into `risk_control_list`(`id`,`post_fk`,`post_name`,`harmful_factors`,`level_fk`,`level_name`,`level_num`,`measure`,`department_fk`,`department_name`,`person_fk`,`person_name`,`risk_control_fk`,`create_time`,`modify_time`,`create_person_fk`,`org_fk`) values ('000a904a60c644c09b34305d311e9d58',NULL,'配电室','配电室无独立的安全措施',NULL,'较大风险',NULL,'配电室应有独立的防雷系统和防火、防潮及防止小动物窜入带电部位的措施\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:13:22',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('01b15f0d3a6f482f82ea36fc068844e9',NULL,'检修作业','在震动筛周边的检修平台，外侧没有设置护栏，振动筛下料口也没有护栏防护',NULL,'一般风险',NULL,'振动筛周边应设置检修平台，平台外侧应设防护栏。振动筛下料口三边应设置护栏隔离\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:20:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('05ecc082774f4efba7972d38a9145717',NULL,'检修作业','焊接时，有闲人观看或裸眼监视，导致焊渣飞溅烧伤衣物或皮肤',NULL,'低风险',NULL,'严格执行操作规程、加强安全教育，提高个人防护，正确穿戴合格的防护用品\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:26:23',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0611d493b7984e8a8431fb0ff90637da',NULL,'供电线路','固定式照明路线没有采用铝绞线，移动式架空照明路线没有采用绝缘导线',NULL,'较大风险',NULL,'固定式架空照明线路宜采用铝绞线；移动式架空照明线路宜采用绝缘导线；移动式非架空照明线路应采用橡套软电缆\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:07:38',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0668baddbdae4b7cb3a58eb7f2db4d8f',NULL,'破碎站','供电电缆老化',NULL,'重大风险',NULL,'对供电电缆进行日常检查，保持电缆绝缘良好，电缆不能与金属管和导电材料接触\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:18:26',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0713fe1851e944918383ac590029b314',NULL,'职业危害','在有职业病危害的工作岗位，没有明显的标识和危害提醒  ',NULL,'较大风险',NULL,'对产生严重职业病危害的作业岗位，应当在其醒目位置，设置警示标识和中文警示说明。警示说明应当载明产生职业病危害的种类、后果、预防以及应急救治措施等内容。\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:31:14',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('078604277b5f499a9354a8e9f407c4ae',NULL,'穿孔','钻机行走时，无人引导',NULL,'一般风险',NULL,'钻机移动时，机下应由人引导和监护，行走时，司机应先鸣笛\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:13:58',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('08f4312342dc46ef863f292d7bf5a26b',NULL,'穿孔','钻机在斜坡道长时间停留',NULL,'较大风险',NULL,'钻机不应长时间在斜坡道上停留\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:10:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('090bcf2ffa4247f3a7390bb795e34a62',NULL,'供电线路','架空线路不符合规定',NULL,'重大风险',NULL,'露天开采的矿山企业，架空线路的设计、敷设应符合GB50061的规定\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:07:59',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0b826573efe244e3ba12d4900b3d3ae0',NULL,'供电线路','采场的供电线路铺设方式不合理',NULL,'较大风险',NULL,' 采矿场的供电线路，宜采用沿采矿场边缘架设的环形或半环形的固定式、干线式或放射式供电线路\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:06:54',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0c503bd2e339455a906782fa5f9801aa',NULL,'挖掘机','有悬浮岩块或崩塌征兆、盲炮等危险情况下进行作业',NULL,'较大风险',NULL,'挖掘机作业时，发现悬浮岩块或崩塌征兆、盲炮等情况，应立即停止作业，并将设备开到安全地带\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:28:24',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0c82e86ed20844b9accb5d2e762472bd',NULL,'配电室','停电线路上未先采取验电等安全措施',NULL,'一般风险',NULL,'在停电线路上工作时，应先采取验电和挂接地线等安全措施。工作完毕，应及时将地线拆除后再通电\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:11:06',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0ea3809a126d4e8ca98e7ee83f11de33',NULL,'自卸矿车','补充燃油时，燃油泄漏，起火',NULL,'较大风险',NULL,'加油时远离火源，禁止吸烟，穿防静电服\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:34:16',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('0f837db5c5e14b9a8591e6f9bdb1e56b',NULL,'爆破','雷电、暴雨天气实施爆破作业',NULL,'重大风险',NULL,'雷电、暴雨雷雨天气禁止实施爆破作业\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:25:29',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('11456ab1fa414b3fbbd86416651cd03b',NULL,'自卸矿车','溜车方式发动汽车',NULL,'较大风险',NULL,'不应采用溜车方式发动车辆，下坡行驶不应空档滑行\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:44:59',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('122b67c535904925a7e0b5cee5ad7d25',NULL,'运矿道路','在运输道路和联络道的长下坡道路未设置汽车避让道',NULL,'较大风险',NULL,'主要运输道路及联络道的长下坡道路，应根据运行安全需要，设置汽车避让道，并符合设计要求',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:11:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1775728ab65d4c2d9beb41d3df24c90f',NULL,'运矿道路','道路两侧边坡不稳定，坡面角与设计不符',NULL,'较大风险',NULL,'道路两侧边坡应能保持长期稳定，其边坡角不得超过设计值的5%或符合设计确定的原则',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:11:09',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('18c6f36e5d854191b446f1effc22fdec',NULL,'装矿平台','边坡浮石未清理前有人员和设备在边坡底部停留',NULL,'一般风险',NULL,'边坡发现浮石应立即进行清理，边坡浮石清除完毕之前，其下方不应生产；人员和设备不应在边坡底部停留',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:06:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('19fd199e779b4cd2b2427859f3151d82',NULL,'挖掘机','上、下台阶同时作业的挖掘机未保持安全距离',NULL,'较大风险',NULL,'上、下台阶同时作业人的挖掘机，应沿台阶正常作业的挖掘机最大挖掘半径3倍的距离，且不小于50m\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:30:32',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1a2a5d23ba754054a2a4199d82673ade',NULL,'工作平台','地质因素对边坡影响，岩层坍塌',NULL,'一般风险',NULL,'加强监护 设置警示',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:59:23',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1b9e82e1edde486db357cd00fedee2e2',NULL,'爆破','违规装填炸药',NULL,'较大风险',NULL,'严禁使用金属器材装填\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:21:01',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1bf4fdb2e44b4eebae62a1b48e90e627',NULL,'爆破','使用明令禁止的材料进行爆破作业',NULL,'重大风险',NULL,'严禁使用明令禁止的材料\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:21:42',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1d02d3a5761443da92ac127c83ee8fa3',NULL,'职业危害','没有配备与职业病防治工作相适应的有效防护措施',NULL,'较大风险',NULL,'应配备与职业病防治工作相适应的有效防护设施\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:30:23',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1eaaaa1eb0314f868c43dcb715c41833',NULL,'采场边坡','采场边坡不稳定区段滑坡',NULL,'较大风险',NULL,'对采场工作帮应进行每季度至少检查一次，不稳定区域段在暴雨过后应及时检查，发现异常应立即处理\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:49:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('1fda35cd70ea426e8513bbeaaeec7a8e',NULL,'采场边坡','未对危险边坡进行处理未设警示标志',NULL,'较大风险',NULL,'进行安全巡视、处理；设置警示标志；加强安全教育\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:50:52',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('215d3beeef5b4dd893207e1a8e32592d',NULL,'自卸矿车','车辆油箱漏油',NULL,'较大风险',NULL,'排查隐患，及时维修\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:41:09',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('233883d1d8994699a855173d6e3d2b04',NULL,'检修作业','作业未佩戴安全带、安全帽等',NULL,'较大风险',NULL,'按要求佩戴劳保用品\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:22:52',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('23acd8cb325142c7af83cb5c9827c4a6',NULL,'爆破','炸药与雷管存放距离太近，临时保管区域有漏电电流',NULL,'较大风险',NULL,'加强漏电电流的监测，加强现场用电设备的管理；\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:21:20',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('242d6b92649a4019b94d51e0f73d45dd',NULL,'装载机','装载机运载物料进出矿山时，因无安全标识和鸣笛，容易发生交通事故。',NULL,'较大风险',NULL,'张贴安全标识鸣号\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:18:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('28c2b96ffe694a809177ca5333be916e',NULL,'穿孔','在压缩机运行或带压时，违规拆卸螺母，注油塞及其他零部件',NULL,'低风险',NULL,'在压缩机运行或带压时，不要拆卸螺母，注油塞及其他零部件\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:11:23',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('29a1ccd028624d31b6d35f339787c721',NULL,'自卸矿车','装车时司机停留在驾驶室踏板上或有落石危险的地方',NULL,'重大风险',NULL,'装车时，汽车司机不应停留在司机室踏板上或有落石危险的地方\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:40:04',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('29c6571afc0447a0b38b6776265d790d',NULL,'装矿平台','地质因素对边坡影响，岩层坍塌',NULL,'一般风险',NULL,'加强监护 设置警示',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:07:21',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('29ddd3c301674c2ba90dcd9ac7adc5e5',NULL,'装矿平台','采场各作业水平上、下台阶之前的超前距离未规定，从下部台阶进行掏采',NULL,'较大风险',NULL,'露天采场各作业水平上、下台阶之间的超前距离，应在设计中明确规定，不应从下部不分台阶掏采，采剥工作面不应形成伞檐、空洞等',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:06:12',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('2bdec1dd4faa4df09ef13e2a20e1ed9c',NULL,'破碎站','卸矿地点无牢固可靠的挡车设施',NULL,'重大风险',NULL,'卸矿地点应设置牢固可靠的挡车设施，并设专人指挥。挡车设施的高度应不小于该卸矿点各种运输车辆最大轮胎直径的2/5\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:17:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('2e3e0b408b694fb2ad51ccfd86229171',NULL,'办公室','办公操作电脑等设备作业时',NULL,'低风险',NULL,'作业安全距离适当；不用电脑时关机节能\n',NULL,'办公室',NULL,'丁志平','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:27:57',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('2ed6a4517432430a9d46817d3eae38f7',NULL,'运矿道路','在矿山道路两侧随意堆放物品',NULL,'低风险',NULL,'堆放物品应堆放稳固，与道路边缘的距离应不小于1m',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:13:29',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3121d797096c44c5b656f04d72ecefce',NULL,'运矿道路','运矿道路路面宽度不够，道路转弯半径不够',NULL,'一般风险',NULL,'双车道的路面宽度，应保证会车安全。陡长坡道的尽端弯道，不宜采用最小平曲线半径，弯道处的会车视距若不能满足要求，则应分设车道，急弯、陡坡、危险地段应有警示标志',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:10:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3197d12ad0e44caeb1e5283e9166b603',NULL,'办公室','拖地后地面湿滑',NULL,'低风险',NULL,'做好现场安全确认\n',NULL,'办公室',NULL,'丁志平','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:29:25',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3268e8e53d144c50a05bbca0cd057a6f',NULL,'自卸矿车','在斜坡道转弯处，交叉路口等处不鸣笛',NULL,'较大风险',NULL,'在斜坡道转弯处、交叉路口等处应先鸣笛，再通过\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:43:38',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('326b4cd01e8e4e76b94e27a9f3876a51',NULL,'破碎站','未设置急停开关',NULL,'较大风险',NULL,'传动部位按要求设置防护罩；输送带按要求设置急停开关\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:17:59',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3595c094c0bf44279cd7cde9ce5597a0',NULL,'穿孔','使用明令禁止的使用的设备',NULL,'重大风险',NULL,'对明令禁止的淘汰设备及时进行淘汰更新\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:07:47',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('39f769c8b0d0479fb3b977452f97d8f6',NULL,'挖掘机','装车时挖掘机距离车辆较近回转撞坏车辆',NULL,'一般风险',NULL,'自卸汽车进入工作面装车，应停在挖掘机尾部回转范围0.5m以外，防止挖掘机回转撞坏车辆\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:31:35',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3df0486a48be46178197612ed02e6575',NULL,'挖掘机','装车时铲斗压碰汽车车帮',NULL,'低风险',NULL,'装车时铲斗不应压碰汽车车帮，铲斗卸矿高度应不超过0.5m，以免震伤司机，砸坏车辆\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:29:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('3f98d1b001a145bbbfcc866b81ffbb08',NULL,'挖掘机','两台以上挖掘机在同一平台上作业时，作业间距不够',NULL,'较大风险',NULL,'两台以上的挖掘机在同意平台上作业时，挖掘机的间距：汽车运输时，应不小于其最大挖掘半径的3倍，且应不小于50m\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:30:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4201d0ec2a1f4fdf95cfc3fcd48564df',NULL,'检修作业','破碎机发生堵塞，在未切断电源的情况下进行处理',NULL,'较大风险',NULL,'破碎机出现堵塞或破碎板松动，应停止上料，并切断链斗和破砰机电源后，进行处理；\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:21:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('427658ca28714b16b49de1c60f407545',NULL,'配电室','矿山电力装置不符合要求',NULL,'重大风险',NULL,'矿山电力装置，应符合GB50070和DL408的要求\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:13:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('42fd29d9336a45dcb8ee7b3d8bd49c56',NULL,'穿孔','钻机稳车时未与台阶坡顶线保持足够的安全距离',NULL,'一般风险',NULL,'钻机稳车时应与台阶坡顶线保持足够的安全距离\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:12:51',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('436f41ec14574faf9ad9fa0fc68897a2',NULL,'穿孔','钻机在挖掘机作业范围内的爆堆台阶面上作业或者停留',NULL,'一般风险',NULL,'挖掘台阶爆堆的最后一个采掘带时，相对于挖掘机作业范围内的爆堆台阶面上、相当于第一排孔位地带，不应有钻机作业或停留\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:11:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('443c6ff54b8e4a3aad3a533a774a0f88',NULL,'爆破','加工药包时不能吸烟或带烟火类物体',NULL,'重大风险',NULL,'禁止吸烟，装药前严格检查\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:20:41',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4604383b603b4864830f8cb9c60127fb',NULL,'自卸矿车','启动前未检查刹车或刹车失灵',NULL,'一般风险',NULL,'使用前认真检查车辆，及时调整紧固调整螺母，防止松动\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:38:57',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4634a506e5874eaa96fa9c6b86f92b26',NULL,'装矿平台','运矿道路路面宽度不够，道路转弯半径不够',NULL,'一般风险',NULL,'双车道的路面宽度，应保证会车安全。陡长坡道的尽端弯道，不宜采用最小平曲线半径，弯道处的会车视距若不能满足要求，则应分设车道，急弯、陡坡、危险地段应有警示标志',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:08:25',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('46acdcc05c824e10ab5c5fff79bd85fb',NULL,'检修作业','防护用品、检测工具不完好，绝缘失效，造成人员伤害。',NULL,'较大风险',NULL,'正确穿戴劳动防护用品，安全绝缘工具定期检验。\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:21:01',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('48d5029021564feb911187cb06fdc629',NULL,'采场边坡','未建立边坡管理制度未对边坡进行安全检查',NULL,'较大风险',NULL,'应建立健全边坡管理和检查制度，对边坡重点部位和有潜在滑坡危险的地段采取有效的防治措施外，还应每5年由有资质的中介机构进行一次检测和稳定性分析\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:50:32',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4aa937f068ce43c99572647d91884677',NULL,'检修作业','拆卸车轮和轮胎充气之前未对车轮进行安全检查',NULL,'一般风险',NULL,'拆卸车轮和轮胎充气之前，应先检查车轮压条和钢圈完好情况，如有缺损，应先放气后拆卸\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:24:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4aeb20e9c8c943f4bac6fbc9a55f7a0a',NULL,'自卸矿车','转向灯失效',NULL,'一般风险',NULL,'开车前认真检查车辆，及时排除隐患\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:35:08',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4cbbbecd995e49f6a2f4d64ec67e4d41',NULL,'检修作业','使用手提磨砂轮时，未仔细检查砂轮片是否有裂纹，防护罩是否完好，电线是否磨损，是否漏电，运转是否良好。',NULL,'一般风险',NULL,'使用前先检查，严格执行操作规程、，提高个人防护，及时检查维修更换等\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:27:07',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('4d6ea04ea64c47cfbb89693a97781030',NULL,'采场边坡','边坡角过陡，形成伞檐',NULL,'较大风险',NULL,'严格按照设计要求进行开采，采场参数应符合设计及相关要求规定\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:48:53',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('508c3f82f4214b16bd8a77dfe934afc6',NULL,'职业危害','用于职业病防护的设备和防护用品出现了失效或停止使用的现象',NULL,'重大风险',NULL,'对职业病防护设备、应急救援设施和个人使用的职业病防护用品，应进行经常性的维护、检修，定期检测其性能和效果，确保其处于正常状态，不得擅自拆除或者停止使用。\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:31:34',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5505e6dcaa744d9d9efc2cb1f0363b2e',NULL,'装矿平台','未采用自上而下、分层或分台阶的方式进行开采',NULL,'较大风险',NULL,'按设计进行开采，定期进行测量',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:03:51',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5538f2d7b25242b6927eb6f12ef4a6e7',NULL,'爆破','雷管的电流、电阻测试应按规程操作进行',NULL,'一般风险',NULL,'严格按操作规程操作\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:20:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('55964ee5cc5542db9376f23108598959',NULL,'职业危害','职业健康管理不完善',NULL,'低风险',NULL,'加强管理，对于职业健康的管理落实到人\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:31:59',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('55d19c84131a40dca09b1c486f2d59e7',NULL,'爆破','爆破后炮烟未散尽人员进入',NULL,'一般风险',NULL,'爆破作业后需炮烟散尽人员方可进入\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:24:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5a48c9e918804793a7d842c64c3fbf07',NULL,'破碎站','卸矿地点没有设置照明装置',NULL,'较大风险',NULL,'应有良好照明系统，卸载站应安装卸料指示灯\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:16:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5ba7fa4d89f446d59ba73a899a3a2123',NULL,'办公室','日常垃圾不及时清理，随意堆放',NULL,'低风险',NULL,'垃圾及时清理\n',NULL,'办公室',NULL,'丁志平','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:28:55',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5bd3a64e5828440e854e6032ed1d23dd',NULL,'破碎站','传送皮带出现过松或者过紧的情况',NULL,'较大风险',NULL,'每班在开工前应该仔细检查，发现问题要及时上报和处理\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:17:38',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('5d5868f8f7a34027a86d1f018996879e',NULL,'破碎站','破碎机腔内爆破作业',NULL,'较大风险',NULL,'严禁破碎机腔内爆破作业\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:15:59',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('60c6798adb8b41478baf6597d7e18d98',NULL,'破碎站','在跨越输送带的地点，没有设置有栏杆的跨线桥',NULL,'较大风险',NULL,'跨越输送带的地点，应设置有栏杆的跨线桥，上下阶梯应有扶手\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:17:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('644529eb47b4439895ca8d95abb823f9',NULL,'自卸矿车','夜间行车不按规定使用灯光',NULL,'较大风险',NULL,'严格按照灯光使用要求正确使用灯光\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:41:34',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('65a125980b004bf8b1c2dbec746c5b7c',NULL,'工作平台','终了边坡角与设计不符',NULL,'重大风险',NULL,'终了边坡角不得超过设计的2%',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:58:44',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('65e99d3ac7e54aa89d670d8d6b4b0186',NULL,'配电室','两个以上单位共同使用和检修输电网路时',NULL,'较大风险',NULL,'应共同制定安全措施，指定专人负责，统一指挥\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:08:33',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('66e05a6a74e4473b9a2264a2bbffaa9e',NULL,'职业危害','职业安全卫生投入不足',NULL,'低风险',NULL,'制定职业卫生投入计划，保证职业卫生的投入\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:33:55',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('672d9de3ae894f5289fba28d079c065b',NULL,'办公室','饮水机长期无人清理',NULL,'低风险',NULL,'定期清理\n',NULL,'办公室',NULL,'丁志平','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:28:33',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('674513f265414948a0b9842e972b2976',NULL,'挖掘机','挖掘机在采场未按规定行驶',NULL,'一般风险',NULL,'挖掘机应在作业平台的稳定范围内行走。挖掘机上下坡时，驱动轴应始终处于下坡方向；铲斗应空载，并下放与地面保持适当距离；悬臂轴线应与行进方向一致。\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:30:53',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('68920d07486a46f58519f1e336cec627',NULL,'检修作业','高空作业将工作回线缠在身上，而地面无人监护',NULL,'一般风险',NULL,'高空作业时，应系好安全带，禁止将工作回线缠在身上，地面安排专人监护\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:22:33',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('697bcf7dc4374b62ab347d2b10e5cca3',NULL,'挖掘机','设备移动时上下人员',NULL,'一般风险',NULL,'设备移动时不应上下人员\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:27:16',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('69d586befc1642f2be4db8e0c0b9d7a3',NULL,'自卸矿车','车辆驾驶时与他人闲聊',NULL,'较大风险',NULL,'严格按照安全操作规程驾驶车辆\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:42:33',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('6bd26c55a5014297af8c4cf3a88d43c5',NULL,'装载机','装载机作业人员无证驾驶，造成交通事故',NULL,'一般风险',NULL,'持证上岗\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:17:36',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('6be94dd4ad2549718165db90abb2f661',NULL,'装矿平台','地震',NULL,'一般风险',NULL,'加强监护 设置警示',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:07:54',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('73a44d0217e04de8ac7dad6e03efcc73',NULL,'检修作业','设备运转时，对破碎设备进行检修、清扫',NULL,'一般风险',NULL,'设备运转时，不应对其转动部分进行检修注油和清扫\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:20:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('73c9d9c093b9417ca2c7289b18bf69bf',NULL,'配电室','配电室附近有杂物活易燃易爆物品 ',NULL,'较大风险',NULL,'配电室应对周边杂物进行及时清理，同时在四周设置警示标志\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:14:12',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('73ca0905a3104e99a00fe1a9ae27eb56',NULL,'供电线路','配电线路穿墙未设置保护管，架空铺设线路高度不够',NULL,'较大风险',NULL,'配电线路穿墙应设置保护管，架空线路高度应满足设计要求\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:06:09',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7596a722b4cc4bcfbe61ea079d831cf5',NULL,'工作平台','在现场能见度底，或有暴风雨、雪或有雷击危险时仍进行现场作业',NULL,'较大风险',NULL,'应立即停止作业；威胁人身安全时，人员应转移到安全地点。',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:53:34','2019-05-28 15:56:39',NULL,'0528160b1191413d81862615dbdd15c3'),('75e3247d335640ac9958726b6be38832',NULL,'装载机','装载机行驶时车门未关好，容易造成人员坠落',NULL,'低风险',NULL,'在作业前后要认真检查车辆情况，确保无误后再进行作业\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:17:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('77b272e790c140799e9bc29543174833',NULL,'配电室','倒闸操作不符合要求',NULL,'较大风险',NULL,'倒闸应该一人操作、一人监护，发现异常情况，应向值班调度报告，查明情况再进行操作\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:11:28',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('794894ca97e544eda2304c79381c08f9',NULL,'自卸矿车','车辆超载刹不住车',NULL,'较大风险',NULL,'禁止超载，下坡路前检查刹车系统\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:41:57',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7b8494bc545f4e73ae13adf66d213f06',NULL,'检修作业','现场检修时与带电体距离小于安全距离，导致人员伤亡',NULL,'一般风险',NULL,'正确穿戴防护用品\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:25:17',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7d2fb10f9a2143ceb426181faa6928cd',NULL,'配电室','配电室不符合要求',NULL,'一般风险',NULL,'配电室的门应向外开，窗户应有金属网栅，四周应有围墙或栅栏，并应有通往配电室的道路\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:13:40',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7dd7cc5e10604ba48bc6ab62abd0f63a',NULL,'自卸矿车','运输设备装载过满或装载不均，或将巨大岩块装入车的一侧',NULL,'低风险',NULL,'运输设备不应装载过满或装载不均，也不应将巨大岩块装入车的一侧，以免引起翻车事故\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:33:50',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7e22c88e5e604755a82767a3260c8d69',NULL,'爆破','在爆破后，没有设置明显的警示标志；没有对爆破区域进行检查',NULL,'低风险',NULL,' 松软岩土或砂矿床爆破后，应在爆区设置明显标志，并对空穴、陷坑等进行安全检查，确认无危险后，方准许恢复作业\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:22:57',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7f7f961c036141af8e9cca0b1bd92320',NULL,'职业危害','未对从业人员进行职业健康检查',NULL,'低风险',NULL,'对接触职业病危害的从业人员组织上岗前、在岗期间和离岗时的职业健康检查\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:34:13',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('7f922af18ff4417fa24eda2268a3e6ff',NULL,'爆破','在怀疑有盲炮时，使用挖掘机盲目作业',NULL,'重大风险',NULL,'当怀疑有盲炮时，应对爆后挖运作业进行监督和指挥，防止挖掘机盲目作业引发爆炸事故\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:23:17',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('800252b784c7496fbd913dda5943b0aa',NULL,'检修作业','作业人员未按要求佩戴安全帽等防护用品',NULL,'较大风险',NULL,'矿区工作人员在进入工作场所时，应按要求佩戴安全帽等防护用品\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:20:17',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('83769e9baa0e406f87a938a587d03d35',NULL,'运矿道路','暴雨、雷电天气车辆运输',NULL,'一般风险',NULL,'暴雨、雷电天气禁止车辆运输',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:14:46',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('848f14512de94878b5e06f5f89e6ed00',NULL,'自卸矿车','在拖挂其他车辆时，没有安排专人在一旁指挥',NULL,'重大风险',NULL,'拖挂其他车辆时，应采取有效的安全措施，并有专人指挥\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:40:27',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('85472a8341a841328acb57986b9b83d0',NULL,'穿孔','钻机靠近台阶边缘行走',NULL,'一般风险',NULL,'钻机靠近台阶边缘行走时，应检查行走路线是否安全；台车外侧突出部分至台阶坡顶线的最小距离为2m\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:13:35',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('85e5ceaded204a99a2e8c89382673474',NULL,'挖掘机','挖掘机作业时，悬臂和铲斗下面及工作面有人停留',NULL,'较大风险',NULL,'挖掘机作业时，悬臂和铲斗下面及工作面附近，不应有人停留\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:28:46',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('8884ae75815146ea894bebd5fa63a287',NULL,'自卸矿车','未保持安全距离行驶',NULL,'较大风险',NULL,'正常作业条件下，同类车不应超车，前后车距离应保持适当。生产干线、坡道上不应无故停车\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:44:02',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('89083be10dbe47a3b9b575ad6a975f10',NULL,'配电室','在电源线路上断电作业时无安全措施',NULL,'较大风险',NULL,'在电源线路上断电作业时，该线路的电源开关把手，应加锁或设专人看护，并悬挂“有人作业，不准送电”的警示牌\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:10:40',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('8c78a61deed24084bda6d8237b29da51',NULL,'检修作业','氧气、乙炔装卸不良气味或有害气体吸入、灼伤',NULL,'较大风险',NULL,'加强安全教育，提高个人防护，严格执行操作规程\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:23:45',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('8d1bd22b14574c3c97f378e795fa7b60',NULL,'配电室','绝缘损坏的橡套电缆',NULL,'一般风险',NULL,'绝缘损坏的橡套电缆，应经修理、试验合格，方准使用。在长度150m范围内，橡套电缆接头应不超过lO个，否则应予以报废\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:12:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('8f6d0f2521b043eaa510fd830327c02c',NULL,'爆破','建筑物距离采场爆破安全距离不够',NULL,'重大风险',NULL,'对不满足安全距离的建筑物进行搬离，对厂外不满足安全距离建筑物签订安全管理协议做好相应的安全保障措施\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:24:39',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('8fa5c8d3add54c0082138060f62be45c',NULL,'工作平台','矿山边界没有设置醒目的标志',NULL,'较大风险',NULL,'露天矿边界应设可靠的围栏或醒目的警示标志，防止无关人员误入',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:00:38',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9001d17e5b024062abc20a80ca42fbaa',NULL,'检修作业','未关闭启动装置、切断动力电源和设备完全停止运转的情况下对设备进行检修',NULL,'较大风险',NULL,'检修设备，应在关闭启动装置、切断动力电源和设备完全停止运转的情况下进行\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:21:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('907990d49c104e3784616f4b70e8fcab',NULL,'自卸矿车','装车时驾驶员离开驾驶室，在危险区域逗留',NULL,'较大风险',NULL,'装车时，不应检查、维护车辆；驾驶员不应离开驾驶室，不应将头和手臂伸出驾驶室外\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:44:36',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('91160aeb2e594436ab0edc01757b8ec5',NULL,'自卸矿车','自卸汽车运载易燃、易燃物品，危险驾驶等',NULL,'较大风险',NULL,'不应用自卸汽车运载易燃、易爆物品；驾驶室外平台、脚踏板及车斗不应载人\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:37:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9133ed7b21ac4931aa1709cc443e0fdd',NULL,'工作平台','无关人员误入矿区',NULL,'较大风险',NULL,'露天矿边界设置可靠的围栏或警示标志，露天矿边界上2m范围内，可能危及人员安全的树木及其它植物、不稳固材料和岩石等，应予以清除',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:57:16',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9208fbbbea6146b2842d0cd4fcf6919f',NULL,'检修作业','检修设备未设专人监护',NULL,'一般风险',NULL,'检修带点设备在切断电源处，电源开关需进行加锁或设专人监护，并悬挂“有人作业，不准送点”的警示牌\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:23:15',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('923addc4e3fb482a9098cec5362ed145',NULL,'爆破','起爆器连接方法不当',NULL,'一般风险',NULL,'加强培训教育，做到连接准确无误\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:19:26',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('94ef677a887c44a8b00584ce4bb89241',NULL,'职业危害','职业安全卫生组织机构不健全',NULL,'低风险',NULL,'完善职业卫生组织机构人员\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:32:29',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9515d61fbb0b4e19a25bb5dfae2d19b2',NULL,'爆破','台阶爆破初期没有按照自上而下的顺序进行分层爆破形成台阶',NULL,'较大风险',NULL,'台阶爆破初期应采取自上而下分层爆破形成台阶，如需进行双层或多层同时爆破，应有可靠的安全措施\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:22:39',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9598e0f7a6764ed5b3b7b927194b1dd7',NULL,'自卸矿车','雾天或烟尘弥漫影响能见度底时',NULL,'一般风险',NULL,'雾天或烟尘弥漫影响能见度时，应开亮车前黄灯与标志灯，并靠右侧减速行驶，前后车间距应不小于30m。视距不足20m时，应靠右暂停行驶，并不应熄灭车前、车后的警示灯\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:37:41',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('99222efbea164c2293dc819c685fe08e',NULL,'装载机','装载机作业时其他人员进入装载机作业区，发生撞伤、压伤',NULL,'较大风险',NULL,'作业时注意观察周边情况，严格按照操作规程进行作业\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:15:12',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9bd4649d2efd4b4aac54906f921c4134',NULL,'穿孔','挖掘机作业范围内的爆堆台面上有钻机作业或停留',NULL,'低风险',NULL,'挖掘机作业范围内的爆堆台面上、相当于第一排孔位地带，不应有钻机作业或停留\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:14:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9d4ab25fcdb1448288b0dc6f8cb0b243',NULL,'职业危害','作业场所和生活场所没有区分，有害作业和无害作业没有分开',NULL,'低风险',NULL,'有害作业应与无害作业分开，高毒作业场所应与其他作业场所隔离，作业场所应与生活场所分开。\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:33:34',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9e4c3e4479434620ac012838de87cb08',NULL,'工作平台','露天矿边坡坡顶线附近的浮石和松散岩层没有进行清理',NULL,'一般风险',NULL,'露天矿边坡坡顶线2m范围内，可能危及人员安全的树木及其他植物、不稳固松散岩土层和材料等，应予清除，其覆盖的松散岩土层厚度超过2m时，其倾角应小于自然安息角。',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:02:16',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('9f9f23d4c350497d83e11cd4e3855796',NULL,'配电室','在带电的导线、设备、变压器、油开关附近存放易燃易爆物品',NULL,'一般风险',NULL,'在带电的导线、设备、变压器、油开关附近，不应有任何易燃易爆物品\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:12:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a26c225a641143fa8a64c488883fecf8',NULL,'自卸矿车','在装车时，驾驶员离开了驾驶室或将手臂伸出车外',NULL,'较大风险',NULL,'装车时，不应检查、维护车辆；驾驶员不应离开驾驶室，不应将头和手臂伸出驾驶室外。\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:43:17',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a2c4d6b3bf5c4320aaeddfa495b66bc7',NULL,'自卸矿车','冰雪或多雨季节道路较滑时',NULL,'一般风险',NULL,'冰雪或多雨季节道路较滑时，应有防滑措施并减速行驶；前后车距应不小于40m；拖挂其它车辆时，应采取有效的安全措施，并有专人指挥\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:38:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a327d31b85804cdcb5559e652731020e',NULL,'办公室','乱扔烟头等',NULL,'一般风险',NULL,'注意卫生\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:29:43',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a4b45a3035434a6b98852e3aea7818a6',NULL,'配电室','作业人员未持证上岗',NULL,'一般风险',NULL,'电气工作人员，应按规定考核合格方准上岗，上岗应穿戴和使用防护用品、用具进行操作。维修电气设备和线路，应由电气工作人员进行\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:09:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a573b6c9795347fcb885647996435118',NULL,'破碎站','人行通道未设置安全标志和照明',NULL,'一般风险',NULL,'人行通道设置安全警示标和照明\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:15:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('a584aa3ce105444e8d9bbe8c711e4a0b',NULL,'挖掘机','未能按操作规程正确操作，铲斗从车辆驾驶室上方通过',NULL,'一般风险',NULL,'挖掘机、前装机铲装作业时，铲斗不应从车辆驾驶室上方通过\n',NULL,'安全科',NULL,'朱鹏