','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:48:32',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('ca8cb24d93f140f8b43b452885163fdc',NULL,'运矿道路','运矿道路未设置安全警示标志',NULL,'一般风险',NULL,'要求车辆按规定设置限速标志；',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:12:21',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('cdc33000ad2948ec93795ef508820eda',NULL,'自卸矿车','车辆行驶过程中车距较小',NULL,'低风险',NULL,'正常作业条件下，同类车不应超车，前后车距离应保持适当。生产干线、坡道上不应无故停车\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:39:36',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('ce7fe1fe5d9649b89a163c4c6720b16c',NULL,'工作平台','工作台阶坡面角与设计不符',NULL,'较大风险',NULL,'工作台阶坡面角不得超过设计的15%',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:58:05',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('cf4090a89bab4af9b759b5a8d085d84a',NULL,'装矿平台','台阶（分层）高度超过设计高度',NULL,'重大风险',NULL,'按照设计设置台阶（分层），定期进行测量',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:04:28',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('cfcd7ceb71734b129581d0ddc84bcc3c',NULL,'自卸矿车','酒后驾驶、疲劳驾驶',NULL,'较大风险',NULL,'进行安全教育禁止疲劳、酒后驾驶\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:45:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d07df297f0b448b699d4fda6722905d2',NULL,'职业危害','职业安全卫生责任制未落实',NULL,'低风险',NULL,'认真落实职业安全卫生责任制\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:32:47',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d1d4c31c75c644f899f55ac24aecad3e',NULL,'配电室','跳闸后强行送电',NULL,'一般风险',NULL,'线路跳闸后，不应强行送电，应立即报告调度，并与用户联系，查明原因，排除故障后，方可送电\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:11:58',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d25a99c407de41268ca89611cab90fdd',NULL,'工作平台','路程较远步行至露天矿山作业场所',NULL,'低风险',NULL,'路程超过3000m的露天矿主要作业场所应配备专用载人车辆接送作业人员上下班',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-28 23:59:55',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d25c687e3e274bf09aa64b30cfbb8e5d',NULL,'检修作业','在距离地面两米以上进行检修作业时，未佩戴安全带',NULL,'一般风险',NULL,'距地面2米以上为高空作业，必须按规定系好安全带、安全帽等劳保用品，传递工具等要有安全措施，工作前由专人检查梯子、脚手架是否坚固可靠。\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:21:58',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d389a8edd423428081b1bb1895a5dcca',NULL,'挖掘机','作业人员未按要求佩戴安全帽等防护用品',NULL,'较大风险',NULL,'作业人员在作业时应按要求佩戴安全帽等防护用品\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:26:48',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d3a7e07c15db457da76357555836d3be',NULL,'挖掘机','挖掘机作业时爆堆高度过高',NULL,'较大风险',NULL,'挖掘机或装载机铲装时，爆堆高度应不大于机械最大挖掘高度的1.5倍\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:28:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d6ad973ffcc8463b99829acaec216806',NULL,'爆破','与爆破作业无关人员进入现场，现场作业人员衣服产生静电',NULL,'一般风险',NULL,'除爆破工作人员其它人禁止进入爆破现场，按规定要求穿戴好劳保防护用品，现场作业人员必须穿防静电服\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:22:07',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('d7f2401a3f8c4ae5ae4ef415d2022969',NULL,'穿孔','钻孔时，钻机中轴线与台阶坡顶线不符合安全要求',NULL,'一般风险',NULL,'穿凿第一排孔时，钻机的中轴线与台阶坡顶线的夹角应不小于45°\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:13:13',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('daffe22ec2664e43a3fb62797a68d3d1',NULL,'配电室','违规停电和送电',NULL,'较大风险',NULL,'供电设备和线路的停电和送电，应严格执行工作票制度\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:10:22',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('dd7a42014fb04ed5a50a238cbed86081',NULL,'检修作业','在举升的车斗下进行检修时，没有采取安全措施',NULL,'一般风险',NULL,'在举升的车斗下检修时，应采取可靠的安全措施\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:24:56',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('dd944ebfe25a4c06b1b8b7e795bc9698',NULL,'穿孔','作业地点靠近道路时，人员与道路的安全距离不够',NULL,'重大风险',NULL,'合理设置作业地点，避免靠近运输道路，当不可避免时应增加安全警示标识，人员必须穿戴反光作业服\n',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:10:51',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('ded6451ab82b4ba3bb52ed453464bcc4',NULL,'装载机','有车辆行驶的现场作业',NULL,'较大风险',NULL,'穿戴劳动防护用品，谨慎驾驶，提高安全意识\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:18:27',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e0026d8b9c65410f912692426a6b1f14',NULL,'供电线路','采场设施未设置专用开关，停送电无工作牌',NULL,'较大风险',NULL,'采场的每台设备，应设有专用的受电开关；停电或送电应有工作牌\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:05:49',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e23fe02cfc9f4e2db4b9eb03b22f51a7',NULL,'检修作业','将手伸入已装配完的变速箱，主轴箱内检查',NULL,'低风险',NULL,'严格执行操作规程、加强安全教育，提高个人防护，及时检查维修更换等\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:26:42',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e31bde7e69bc43f2b7e54221ad8e17a5',NULL,'供电线路','矿山电气设备、线路无防雷、接地装置',NULL,'较大风险',NULL,'矿山电气设备、线路，应设有可靠的防雷、接地装置，并定期进行全面检查和监测，不合格的应及时更换或修复\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:06:32',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e3d747f998514bf09973c9e156c60f2d',NULL,'配电室','配电室周边没有设置护栏',NULL,'一般风险',NULL,'露天或露天变电所的变压器四周应设高度不低于1.8m的固定围栏和围墙\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:14:32',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e5321a248f0d4ddab8a82ebe61b30651',NULL,'运矿道路','道路挡墙不满足安全要求',NULL,'较大风险',NULL,'按设计要求设置道路挡墙',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:12:57',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e5b43645a01445db909a09d933a27957',NULL,'采场边坡','边坡的安全坡面角不符合要求',NULL,'较大风险',NULL,'邻近最终边坡作业时，应保持台阶的安全坡面角，不应超挖坡底\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:47:51',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e632a651bad8474eadc86988ffbd3246',NULL,'爆破','爆破现场未设置避炮棚',NULL,'一般风险',NULL,'爆破作业场所应设置坚固的人员避炮设施，设置地点、结构及拆移，应在采掘计划中规定，并经主管矿长批准\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:24:00',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e6554129f1ab481fbb2a03c900b630de',NULL,'配电室','在带电设备周围，使用钢卷尺和带金属丝的线尺',NULL,'一般风险',NULL,'在带电设备周围，不应使用钢卷尺和带金属丝的线尺\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:08:52',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e6d6cbeeefdc4a8f86f9e64f4c0a8f0c',NULL,'穿孔','穿孔设备移动时上下人员',NULL,'一般风险',NULL,'穿孔设备移动时不应上下人员\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:12:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('e9f251ebae95441687e7de053f28af1c',NULL,'职业危害','在企业名称、法定代表人或者主要负责人发生变化时，未向原申报机关申报变更职业病危害项目内容',NULL,'低风险',NULL,'用人单位工作场所、名称、法定代表人或者主要负责人发生变化的，自发生变化之日起15日内进行申报\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:34:34',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('ec848e6d7c984a6aabde816cfbc32b94',NULL,'穿孔','钻机与下部台阶接近坡底线的电铲在同时作业',NULL,'较大风险',NULL,'钻机与下部台阶接近坡底线的电铲不应同时作业\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:10:29',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('ee42bce9c9454199a363b12fa8b7aab8',NULL,'检修作业','机械运行时进行设备调整、清理和维护',NULL,'一般风险',NULL,'按章操作，运行中设备严禁进行调整、清理和维护\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:19:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f228fad8583242cd8061eef520f611a1',NULL,'职业危害','在有可能出现职业损伤的工作场地，没有放置现场急救用品',NULL,'较大风险',NULL,'现场急救用品、冲洗设备等应设在可能发生急性职业损伤的工作场所或者临近地点，并在醒目位置设置清晰的标识。\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:30:44',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f2b38c77a45b480db4a224fd3115d54f',NULL,'装矿平台','未按要求预留安全平台、清扫平台、输送平台',NULL,'较大风险',NULL,'预留安全平台宽度应不小于6m',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:05:03',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f332b3508d2f4fbf9d8e381fa9b78764',NULL,'检修作业','检修时车辆滑移、突然启动',NULL,'一般风险',NULL,'车辆检修时车斗复位，变速器置入空档，刹手刹，切断电源，取下车钥匙\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:27:26',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f34af34d91a943cba32f878aaf2490e4',NULL,'自卸矿车','设备移动时上下人员',NULL,'一般风险',NULL,'设备移动时不应上下人员\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:34:40',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f49929e9268041f4b4fd24022bf63d4d',NULL,'检修作业','补充燃油时，燃油泄漏，起火',NULL,'一般风险',NULL,'加油时远离火源，禁止吸烟，穿防静电服\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:25:58',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f4bbed7dc2364b2eb3ad89712846b3e2',NULL,'爆破','放炮时未及时设置警戒人员未及时撤离至安全区域',NULL,'较大风险',NULL,'无关人员禁止进入爆破区、全部人员撤离至安全区域后进行爆破作业；\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:23:40',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f51c81e2c9a9423bbdf8c9d827c9e569',NULL,'装载机','装载机、倒运车辆车况不好，工作时机械失灵易造成事故',NULL,'较大风险',NULL,'及时检查保养\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:16:31',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f531567dc0d643d9aa6b83b2968df836',NULL,'装矿平台','自卸汽车在进入工作面装车时，与挖掘机之间的安全距离较近',NULL,'重大风险',NULL,'自卸汽车进入工作面装车，应停在挖掘机尾部回转范围0.5m以外，防止挖掘机回转撞坏车辆。装车时，不应检查、维护车辆。',NULL,'公司',NULL,'宋道辉','252cf0940a0747f2871c305203a5e02f','2019-05-29 00:05:39',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f6d878afdd3547c69390897a6ba03db5',NULL,'穿孔','在进行高空作业时，作业人员未佩戴安全带',NULL,'低风险',NULL,'不应双层作业，高空作业时，应系好安全带\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:09:33',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f7d5979eceb649b2b3e6cf52a960e10c',NULL,'穿孔','钻机行走坡度较陡',NULL,'一般风险',NULL,'钻机不宜在坡度超过15°的破面上行走，如破面超过15°，应放下钻架，由专人指挥，并采取防倾覆装置\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:14:23',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('f8b1db8e6c4d4d42a1307d6574a9280b',NULL,'破碎站','设备未进行接地',NULL,'较大风险',NULL,'机电设备按要求进行接地\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:16:37',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('fda29837ec42479ab75e9fa6902fa12f',NULL,'挖掘机','酒后驾驶、疲劳驾驶',NULL,'较大风险',NULL,'进行安全教育禁止疲劳、酒后驾驶\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:31:54',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('fe857b25df9f4c41afda3f5ea4697ba3',NULL,'采场边坡','作业面凹陷，导致汛期排水不及时',NULL,'较大风险',NULL,'按设计开采，加强巡查，防止出现作业面凹陷及积水\n',NULL,'安全科',NULL,'蒋涛','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:49:18',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('feb6dd58018e44f59855bbea8a2adf75',NULL,'配电室','电气设备可能被人触及的裸露带电部分',NULL,'一般风险',NULL,'应设置保护罩或遮栏及警示标志\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:09:53',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('fec04a8cf59c48818afebd4978a23389',NULL,'职业危害','职业安全卫生管理制度不完善',NULL,'低风险',NULL,'完善职业卫生管理制度\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 17:33:11',NULL,NULL,'0528160b1191413d81862615dbdd15c3'),('fffae94898c5494cacab14512285c153',NULL,'挖掘机','挖掘机铲斗处理粘厢车辆',NULL,'低风险',NULL,'不应用挖掘机铲斗处理粘厢车辆\n',NULL,'安全科',NULL,'朱鹏','252cf0940a0747f2871c305203a5e02f','2019-06-19 16:29:41',NULL,NULL,'0528160b1191413d81862615dbdd15c3');

/*Table structure for table `risk_dict` */

DROP TABLE IF EXISTS `risk_dict`;

CREATE TABLE `risk_dict` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `code` varchar(255) DEFAULT NULL COMMENT '分类编码',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `value` varchar(255) DEFAULT NULL COMMENT '值',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
