/*Table structure for table `risk_identification_list` */

DROP TABLE IF EXISTS `risk_identification_list`;

CREATE TABLE `risk_identification_list` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `post_fk` varchar(32) DEFAULT NULL COMMENT '岗位单元ID',
  `post_name` varchar(255) DEFAULT NULL COMMENT '岗位单元名称',
  `harmful_factors_fk` varchar(32) DEFAULT NULL COMMENT '危险有害因素ID',
  `harmful_factors` varchar(255) DEFAULT NULL COMMENT '危险有害因素',
  `trouble_fk` varchar(32) DEFAULT NULL COMMENT '事故类型ID',
  `trouble_name` varchar(255) DEFAULT NULL COMMENT '事故类型名称',
  `cause` varchar(255) DEFAULT NULL COMMENT '原因',
  `consequence` varchar(255) DEFAULT NULL COMMENT '后果',
  `incidence` varchar(255) DEFAULT NULL COMMENT '影响范围',
  `possibility` varchar(255) DEFAULT NULL COMMENT '可能性',
  `seriousness` varchar(255) DEFAULT NULL COMMENT '严重性',
  `measure` varchar(255) DEFAULT NULL COMMENT '现有措施有效性',
  `num_l` float(5,2) DEFAULT NULL COMMENT '事故发生的可能性(L)',
  `num_e` float(5,2) DEFAULT NULL COMMENT '暴露于危险环境的频繁程度(E)',
  `num_c` float(5,2) DEFAULT NULL COMMENT '发生事故产生的后果（C）',
  `num_d` float(7,2) DEFAULT NULL COMMENT 'D值',
  `level_fk` varchar(32) DEFAULT NULL COMMENT '安全风险等级ID',
  `level_name` varchar(255) DEFAULT NULL COMMENT '安全风险等级名称',
  `level_num` varbinary(32) DEFAULT NULL COMMENT '安全风险等级序号（排序使用）',
  `risk_identification_fk` varchar(32) DEFAULT NULL COMMENT '关联ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `person_name` varchar(255) DEFAULT NULL COMMENT '责任人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='安全风险辨识清单列表';

/*Data for the table `risk_identification_list` */

