/*Table structure for table `risk_notice` */

DROP TABLE IF EXISTS `risk_notice`;

CREATE TABLE `risk_notice` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `state` smallint(6) DEFAULT '0' COMMENT '状态 0 初始可编辑 1 生效不可编辑',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='安全风险公告栏';

