/*Table structure for table `safety_notification_card` */

DROP TABLE IF EXISTS `safety_notification_card`;

CREATE TABLE `safety_notification_card` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `job_name` varchar(255) DEFAULT NULL COMMENT '工作内容',
  `job_position` varchar(255) DEFAULT NULL COMMENT '工作场所',
  `emergency_measure` varchar(255) DEFAULT NULL COMMENT '应急措施',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='岗位安全风险告知卡';

