/*Table structure for table `safety_notification_card_list` */

DROP TABLE IF EXISTS `safety_notification_card_list`;

CREATE TABLE `safety_notification_card_list` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `harmful_factors_fk` varchar(255) DEFAULT NULL COMMENT '危险有害因素ID',
  `harmful_factors` varchar(255) DEFAULT NULL COMMENT '危险有害因素',
  `trouble_fk` varchar(255) DEFAULT NULL COMMENT '事故类别ID',
  `trouble_name` varchar(255) DEFAULT NULL COMMENT '事故类别名称',
  `control_measure` varchar(255) DEFAULT NULL COMMENT '管控措施',
  `create_person_fk` varchar(255) DEFAULT NULL COMMENT '填写人ID',
  `org_fk` varchar(255) DEFAULT NULL COMMENT '所属机构ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `safety_notification_card_fk` varchar(255) DEFAULT NULL COMMENT '安全告知卡父ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='岗位安全风险告知卡列表';

/*Data for the table `safety_notification_card_list` */

insert  into `safety_notification_card_list`(`id`,`harmful_factors_fk`,`harmful_factors`,`trouble_fk`,`trouble_name`,`control_measure`,`create_person_fk`,`org_fk`,`create_time`,`modify_time`,`safety_notification_card_fk`) values ('00702abc89f54a49bc4ecc3f4aa9e3f7',NULL,'',NULL,'','',NULL,NULL,'2019-06-18 07:26:15',NULL,'2120a74071524f84b813d5424e93176d'),('008bb2eec2b14ba4be2080c59f27c6a6',NULL,'卸矿地点无牢固可靠的挡车设施',NULL,'车辆伤害、高处坠落','卸矿地点应设置牢固可靠的挡车设施，并设专人指挥。挡车设施的高度应不小于该卸矿点各种运输车辆最大轮胎直径的2/5',NULL,NULL,'2019-06-18 14:08:49',NULL,'daa78237a80d42d395e12c34e69b6123'),('0163a59d43ae46d797d6f74986523b0d',NULL,'23232',NULL,'23','232',NULL,NULL,'2019-08-21 20:20:00',NULL,'1c2e1989ddae4092aba33391fc9511c3'),('01d577c8e542400a88a14ab294939722',NULL,'3',NULL,'33','333',NULL,NULL,'2019-06-02 00:42:30',NULL,'4e839da29b0f471ca97f3a56d5542285'),('0222cc4b3650464587327ca4f4a62e1c',NULL,'工作中发现焊机内有异物或不正常时，未立即断电进行检查',NULL,'触电、灼烫','严格执行操作规程、加强安全教育，提高个人防护，及时检查维修更换等',NULL,NULL,'2019-06-18 13:19:59',NULL,'ee9b30d78c0e461bae7defbf379284c1'),('022b8fd70e8045ae95ee9eaa6d8ea926',NULL,'坡道停车时，司机离开车辆',NULL,'车辆伤害','在坡道上停车时，司机不应离开；应使用停车制动，并采取安全措施',NULL,NULL,'2019-06-18 13:56:33',NULL,'3bdf3a894f26494680df25bf8942b29f'),('0231415be3494d1fb027c4758e5960aa',NULL,'11',NULL,'22','33',NULL,NULL,'2019-06-02 00:27:48',NULL,'bf4eac853ec640e19d3ece9445b11866'),('06812af79f984a7dbcc623365fabab60',NULL,'设备运转时，对破碎设备进行检修、清扫',NULL,'机械伤害','设备运转时，不应对其转动部分进行检修注油和清扫',NULL,NULL,'2019-06-18 14:22:07',NULL,'b840f06fb19e40eda1eb8e328e68cd64'),('0758098e0b0d452ebf364e5ba889bea9',NULL,'13',NULL,'11','111',NULL,NULL,'2019-06-03 19:44:06',NULL,'1'),('076eba8da754413c95dc42adc4d2eae0',NULL,'检修设备未设专人监护',NULL,'机械伤害、触电','检修带点设备在切断电源处，电源开关需进行加锁或设专人监护，并悬挂“有人作业，不准送点”的警示牌',NULL,NULL,'2019-06-18 14:22:07',NULL,'b840f06fb19e40eda1eb8e328e68cd64'),('08aaa58ca1334afd9fed0dbad033c099',NULL,'1、身体或衣物被输送机滚筒缠住。 2、违章作业、跨越皮带。',NULL,'机械伤害','1.按规定穿戴整齐。 2.人员正确操作，搞好自主保安。 3.杜绝野蛮操作，严禁开机时清理运转部位卫生。',NULL,NULL,'2019-06-18 14:12:28',NULL,'fa4ac5dde167475c8675d30b122ec6b9'),('0b1d7522f0784d699246184e7f49ec52',NULL,'矿山电力装置不符合要求',NULL,'火灾、其他伤害','矿山电力装置，应符合GB50070和DL408的要求',NULL,NULL,'2019-06-18 14:05:52',NULL,'e8df132dc2964a689aa5565f4e76384e'),('0b76d6b29fd7474fb7cc127a64975b73',NULL,'配电室不符合要求',NULL,'触电、其他伤害','配电室的门应向外开，窗户应有金属网栅，四周应有围墙或栅栏，并应有通往配电室的道路',NULL,NULL,'2019-06-18 14:05:52',NULL,'e8df132dc2964a689aa5565f4e76384e'),('0fae821c2d8e4ee39dfda15dfe751103',NULL,'卡',NULL,'','',NULL,NULL,'2019-06-02 14:05:56',NULL,'1b26b6e8d9b946a298c74e3c4da935ed'),('0fb419691dab4a509f8ec577af82b7fe',NULL,'使用明令禁止的使用的设备',NULL,'机械伤害、其他伤害','对明令禁止的淘汰设备及时进行淘汰更新',NULL,NULL,'2019-06-18 13:48:03',NULL,'5c936497913547d29197a9b41f7e3e99'),('10a0a59e9d2843efa5cc3cc56b638b32',NULL,'',NULL,'','',NULL,NULL,'2019-06-18 07:26:15',NULL,'2120a74071524f84b813d5424e93176d'),('13f23e0dd7064a20bac4e1dd97d5685a',NULL,'有悬浮岩块或崩塌征兆、盲炮等危险情况下进行作业',NULL,'坍塌、火药爆炸','挖掘机作业时，发现悬浮岩块或崩塌征兆、盲炮等情况，应立即停止作业，并将设备开到安全地带',NULL,NULL,'2019-06-18 13:48:03',NULL,'5c936497913547d29197a9b41f7e3e99'),('1458e5846d6a4ecca60436abcec81af3',NULL,'爆破现场未设置避炮棚',NULL,'物体打击','爆破作业场所应设置坚固的人员避炮设施，设置地点、结构及拆移，应在采掘计划中规定，并经主管矿长批准',NULL,NULL,'2019-06-18 13:35:44',NULL,'7047aded87cf41f9b54a46f30fd3d6ab'),('1667182cf53845e580bc103eae12e3c4',NULL,'钻机行走坡度较陡',NULL,'高处坠落','钻机不宜在坡度超过15°的破面上行走，如破面超过15°，应放下钻架，由专人指挥，并采取防倾覆装置',NULL,NULL,'2019-06-18 13:30:36',NULL,'6613170651bb40d49c032843d3450fb1'),('188004c292c14132a6e00b11fc3cb3f6',NULL,'装车时司机停留在驾驶室踏板上或有落石危险的地方',NULL,'车辆伤害、物体打击','装车时，汽车司机不应停留在司机室踏板上或有落石危险的地方',NULL,NULL,'2019-06-18 13:56:33',NULL,'3bdf3a894f26494680df25bf8942b29f'),('195c078fc13143a580b3971a2d16bc0d',NULL,'',NULL,'','',NULL,NULL,'2019-06-18 07:26:15',NULL,'2120a74071524f84b813d5424e93176d'),('1b75c18fc776406fb724309f3cac8f91',NULL,'气焊、气割和焊接设备安全装置有缺陷，或违反安全操作规程。',NULL,'灼烫','气焊、气割时正确使用防护用品，高空作业时，并将安全带挂在牢靠稳固的物体上，才能进行焊割作业。',NULL,NULL,'2019-06-18 13:48:22',NULL,'6cbd4e8ed8ed404086a53cd4284906ee'),('1bf62a5024ea4b47af284b3007508795',NULL,'焊割炬中氧—丙烷混合气体的喷射速度小于燃烧速度引起火焰倒向焊割炬及橡皮管内；管道破损老化，发生泄漏。',NULL,'火灾、爆炸','焊割过程中，遇回火应立即关闭焊割炬上的乙炔阀门，再关闭氧气阀门，稍等一会，再打开氧气阀门吹击里面的余焰和碳质微粒，即可熄灭回火；',NULL,NULL,'2019-06-18 13:48:22',NULL,'6cbd4e8ed8ed404086a53cd4284906ee'),('1dd630783cd84c139baac730c11e2a4e',NULL,'挖掘机在采场未按规定行驶',NULL,'车辆伤害','挖掘机应在作业平台的稳定范围内行走。挖掘机上下坡时，驱动轴应始终处于下坡方向；铲斗应空载，并下放与地面保持适当距离；悬臂轴线应与行进方向一致。',NULL,NULL,'2019-06-18 13:48:03',NULL,'5c936497913547d29197a9b41f7e3e99'),('206441c3aa4e47e29f6540bba57e3fe6',NULL,'设备的走台、梯子、地板及人员通行和操作的场所未设置护栏、踢脚板，堆放杂物等',NULL,'高处坠落、物体打击、机械伤害','对危险区域设置护栏、踢脚板，保持整洁，不应堆放杂物，并及时清除上面的石块',NULL,NULL,'2019-06-18 14:08:49',NULL,'daa78237a80d42d395e12c34e69b6123'),('260747b545b444f7afd0db5e2596c94d',NULL,'',NULL,'','',NULL,NULL,'2019-06-18 13:15:42',NULL,'60390896db1e42b3ad113834d507bf53'),('285693896243448a888eac244d0cb70b',NULL,'',NULL,'','',NULL,NULL,'2019-08-21 20:19:17',NULL,'b705d537eb874139a6328e4babe4bc10'),('2ec993de7db640f4bc98b51c8261fbb4',NULL,'焊接时，有闲人观看或裸眼监视，导致焊渣飞溅烧伤衣物或皮肤',NULL,'灼烫','严格执行操作规程、加强安全教育，提高个人防护，正确穿戴合格的防护用品',NULL,NULL,'2019-06-18 13:19:59',NULL,'ee9b30d78c0e461bae7defbf379284c1'),('2f8a7f68a0044eb6ba37eb31614c56ea',NULL,'违规停电和送电',NULL,'触电、火灾','供电设备和线路的停电和送电，应严格执行工作票制度',NULL,NULL,'2019-06-18 14:05:52',NULL,'e8df132dc2964a689aa5565f4e76384e'),('314a42f360194989928ed1ff59622d60',NULL,'防护用品、检测工具不完好，绝缘失效，造成人员伤害。',NULL,'触电','正确穿戴劳动防护用品，安全绝缘工具定期检验。',NULL,NULL,'2019-06-18 14:22:07',NULL,'b840f06fb19e40eda1eb8e328e68cd64'),('31cdec77db714311b2b3622baf801bdb',NULL,'挖掘机铲斗处理粘厢车辆',NULL,'车辆伤害','不应用挖掘机铲斗处理粘厢车辆',NULL,NULL,'2019-06-18 13:48:03',NULL,'5c936497913547d29197a9b41f7e3e99'),('326d9a261b814ef0b88deb8fb6b7e61b',NULL,'作业完毕，未关主电源开关',NULL,'灼烫、火灾','严格执行操作规程、加强安全教育，在作业完毕后，认真检查，确保关闭电源',NULL,NULL,'2019-06-18 13:19:59',NULL,'ee9b30d78c0e461bae7defbf379284c1'),('35ee5b3e0f0b46a48cfc87d881b15e3b',NULL,'两台以上挖掘机在同一平台上作业时，作业间距不够',NULL,'车辆伤害、物体打击','两台以上的挖掘机在同意平台上作业时，挖掘机的间距：汽车运输时，应不小于其最大挖掘半径的3倍，且应不小于50m',NULL,NULL,'2019-06-18 13:48:03',NULL,'5c936497913547d29197a9b41f7e3e99'),('387694af9356435ebe09510cfd2895f1',NULL,'',NULL,'','',NULL,NULL,'2019-06-18 13:15:42',NULL